  state = {
    dishes: [],
    error: '',
  }

  componentDidMount() {
      Axios
        .get('http://localhost:3300/api/dishes/topfive')
        .then(res => {
            this.setState({
                dishes: res.data.dishes,
                error: ''
            })
        })
        .catch(err => {
            console.log(err);
